import React, {useEffect, useState} from 'react';
import { movies } from "./components/movies";
import './App.css';

function App() {
  const [movies, setMovies] = useState([])
  useEffect(() => {
    fetch("http://localhost:5000").then(response => response.json().then(data => {
      setMovies(data);
    }))
  }, []);

  console.log(movies);

  return (
    <div className="App">
      <movies movies = { movies }/>
    </div>
  );
}

export default App;
